import React, { useState, useEffect } from "react";
import Navigation from "./components/Navigation";
import RecentTrades from "./components/RecentTrades";
import BiggestWinsLosses from "./components/BiggestWinsLosses";
import Summary from "./components/Summary";
import "./components/styles/trades.css";

import {
  formatDate,
  showSuccessModal,
  showUnsuccessModal,
  fetchRecentTrades,
  handleNewTradeSubmit,
  handleRefresh,
} from "./components/Utility";

const Trades = ({}) => {
  const [recentTrades, setRecentTrades] = useState([]);

  useEffect(() => {
    fetchRecentTrades(setRecentTrades, showSuccessModal, showUnsuccessModal);
  }, []);
  return (
    <div>
      <div className="navigation-home">
        <Navigation />
      </div>
      <div className="trades">
        <div className="summary-trades">
          <Summary recentTrades={recentTrades} />
        </div>
        <div className="winloss-trades">
          <BiggestWinsLosses recentTrades={recentTrades} />
        </div>
      </div>
      <div className="trades-trades">
        <RecentTrades
          recentTrades={recentTrades}
          formatDate={formatDate}
          onRefresh={() =>
            handleRefresh(
              fetchRecentTrades,
              showSuccessModal,
              showUnsuccessModal
            )
          }
        />
      </div>
    </div>
  );
};

export default Trades;
